int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(0);
    cout.tie(0);
    int n, m;
    cin >> n >> m;

    multiset<int> ticketPrices;
    vector<int> customerPrices(m);
    for (int i = 0; i < n; ++i) {
        int price;
        cin >> price;
        ticketPrices.insert(price);
    }
    for (int i = 0; i < m; ++i) {
        cin >> customerPrices[i];
    }
    for (int i = 0; i < m; ++i) {
        auto it = ticketPrices.upper_bound(customerPrices[i]);
        if (it == ticketPrices.begin()) {
            cout << -1 << endl;
        } else {
            --it;
            cout << *it << endl;
            ticketPrices.erase(it);
        }
    }

    return 0;
}
